import { Box, SxProps, Theme, Typography } from "@mui/material";
import { useEffect, VFC } from 'react';

import C1 from "../../resources/piano/C1.mp3"
import D1 from "../../resources/piano/D1.mp3"
import E1 from "../../resources/piano/E1.mp3"
import F1 from "../../resources/piano/F1.mp3"
import G1 from "../../resources/piano/G1.mp3"
import A1 from "../../resources/piano/A1.mp3"
import B1 from "../../resources/piano/B1.mp3"
import C2 from "../../resources/piano/C2.mp3"

const Sample: VFC = () => {
    const handleKeyDown = (event: KeyboardEvent) => {
        if (event.key === 'q') {
            var sound = new Audio(C1);
            sound.play();
        }
        if (event.key === 'w') {
            var sound = new Audio(D1);
            sound.play();
        }
        if (event.key === 'e') {
            var sound = new Audio(E1);
            sound.play();
        }
        if (event.key === 'r') {
            var sound = new Audio(F1);
            sound.play();
        }
        if (event.key === 't') {
            var sound = new Audio(G1);
            sound.play();
        }
        if (event.key === 'y') {
            var sound = new Audio(A1);
            sound.play();
        }
        if (event.key === 'u') {
            var sound = new Audio(B1);
            sound.play();
        }
        if (event.key === 'i') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'o') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'p') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === '@') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === '[') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'z') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'x') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'c') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'v') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'b') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'n') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === 'm') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === ',') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === '.') {
            var sound = new Audio(C2);
            sound.play();
        }
        if (event.key === '/') {
            var sound = new Audio(C2);
            sound.play();
        }
    }

    useEffect(() => {
        document.addEventListener('keydown', handleKeyDown, false)
    }, [])

    return <Typography></Typography>
}

export const Main = () => {
    return (
        <Box className="HeMainader" sx={sx}>
            <Sample></Sample>
        </Box>
    );
};

const sx: SxProps<Theme> = {
    "&.Main": {
        width: "100%",
    },
};
